//SPDX-License-Identifier: MIT

pragma solidity ^0.8.14;
contract Inssurance{
    mapping(uint256=>Farmer) farmers;
    mapping(address=>Farmer) addressesToFarmers;
    mapping(address=>uint) addressesToDate;
    uint256 public fees = 10000000000000000;
    address payable contractOwner;
    mapping(address => uint256) public addressToAmountReimb;
    
    //uint256 id;
    //mapping(uint256=>)
    struct Farmer{
        string userName;
		string email;
		string number;
		string x;
		string y;
        uint amountFunded;
        uint amountReimb;
        address payable farmerAddress;
        bool registred ;
        bool payed;
        uint expirationDate;
    }
    constructor(){
        contractOwner = payable(msg.sender);
        //id = 0;
    }
    function getBalance() public view returns(uint256){
        return address(this).balance;
    }
    
    function register(string memory _name, string memory _email, string memory _number, string calldata _x, string memory _y)public{
        require(addressesToFarmers[msg.sender].registred ==false, "already registred");
        //addressesToFarmers[farmers[id].farmerAddress] = farmer;
        addressesToFarmers[msg.sender].userName = _name;
        addressesToFarmers[msg.sender].email=_email;
        addressesToFarmers[msg.sender].number = _number;
        addressesToFarmers[msg.sender].x = _x;
        addressesToFarmers[msg.sender].y = _y;
        addressesToFarmers[msg.sender].registred=true;
        addressesToFarmers[msg.sender].farmerAddress = payable(msg.sender);
        addressesToFarmers[msg.sender].payed = false;
        //id+=1;
    }
    function pay(uint time) public payable{
        require(addressesToFarmers[msg.sender].registred==true,"Register before payment");
        require(addressesToFarmers[msg.sender].payed == false, "already payed");
        require(msg.value>fees,"Need to pay exactly 1ETH");
        addressesToFarmers[msg.sender].payed =true;
        addressesToFarmers[msg.sender].amountFunded +=msg.value;
        addressesToFarmers[msg.sender].expirationDate =time;

    }
    
    function getFarmer(address _add) public view returns(address farmerAddress, string memory name,string memory email, string memory number, string memory x, string memory y, bool registred,bool payed, uint amountFunded, uint amountReimb, uint t){
        farmerAddress = addressesToFarmers[_add].farmerAddress;
        name = addressesToFarmers[_add].userName;
        registred = addressesToFarmers[_add].registred;
        payed = addressesToFarmers[_add].payed;
        email = addressesToFarmers[_add].email;
        number = addressesToFarmers[_add].number;
        x = addressesToFarmers[_add].x;
        y = addressesToFarmers[_add].y;
        amountFunded = addressesToFarmers[_add].amountFunded;
        amountReimb = addressesToFarmers[_add].amountReimb;
        t = addressesToFarmers[_add].expirationDate;
        return(farmerAddress, name, email, number, x, y, registred, payed, amountFunded, amountReimb, t);

    }

    function withdraw(uint value) public onlyOwner{
        uint value1 = value * 10**18;
        (bool callSuccess, ) = payable(msg.sender).call{value: value1}("");
        require(callSuccess, "Call failed");
    }

    function remboursser (uint damage) external {
        require(damage > 3, "you don't need to be reimborssed");
        require(addressesToFarmers[msg.sender].registred==true,"you're not registred");
        require(addressesToFarmers[msg.sender].payed == true, "you need to pay your fees"); 
        if(damage<6){
        payable(msg.sender).transfer(0.3*10**18);
		addressToAmountReimb[msg.sender] += 0.3*10**18;
        addressesToFarmers[msg.sender].amountReimb += 0.3*10**18;
        }
        if((damage <=8) && (damage>=6)){
        payable(msg.sender).transfer(0.4*10**18);
		addressToAmountReimb[msg.sender] += 0.4*10**18;
        addressesToFarmers[msg.sender].amountReimb += 0.4*10**18;
        }
        if((damage <11) && (damage>8)){
        payable(msg.sender).transfer(0.6*10**18);
		addressToAmountReimb[msg.sender] += 0.6*10**18;
        addressesToFarmers[msg.sender].amountReimb += 0.6*10**18;
        }
    }

    modifier onlyOwner {
		require(msg.sender==contractOwner,"Only owner can call this method");
		_;
	}

    function unregister(address farmerAddress) public{
        require(addressesToFarmers[farmerAddress].registred==true,"you're not registred");
		addressesToFarmers[farmerAddress].payed = false;
	}
    
}
